import { Box, useTheme } from "@mui/material";
// import { DataGrid } from "@mui/x-data-grid"; // If you plan to use this, uncomment it
// import { mockDataInvoices } from "../../data/mockData"; // If needed, uncomment it
import Header from "../../components/Header";
import { tokens } from "../../theme";

const LiquidTanks = () => {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);

  return (
    <Box m="20px">
      <Header title="Tanks" subtitle="All liquid holding tanks" />
      <Box
        m="40px 20px 0 0"
        height="75vh"
        display="flex" // Use flexbox for layout
        alignItems="center" // Center items vertically
        justifyContent="center" // Center items horizontally
      >
        <Box
          bgcolor={colors.primary[500]} // Use theme color for background
          color={colors.grey[100]} // Set text color
          p={3} // Padding
          borderRadius="8px" // Rounded corners
          boxShadow={3} // Add some shadow
          textAlign="center" // Center text inside the box
        >
          Simple Box Content Here
        </Box>
      </Box>
    </Box>
  );
};

export default LiquidTanks;
